DROP TABLE IF EXISTS `poliza`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `poliza` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `compania` int(11) DEFAULT NULL,
  `cliente` int(11) DEFAULT NULL,
  `numero_poliza` varchar(45) DEFAULT NULL,
  `comienzo` date DEFAULT NULL,
  `vencimiento` date DEFAULT NULL,
  `producto` int(11) DEFAULT NULL,
  `tipo_producto` int(11) DEFAULT NULL,
  `premio` decimal(9,2) DEFAULT NULL,
  `prima` decimal(9,2) DEFAULT NULL,
  `moneda` int(11) DEFAULT NULL,
  `comision_porcentaje` decimal(9,2) DEFAULT NULL,
  `comision_valor` decimal(9,2) DEFAULT NULL,
  `comision_vendedor_porcentaje` decimal(9,2) DEFAULT NULL,
  `comision_vendedor_valor` decimal(9,2) DEFAULT NULL,
  `forma_pago` int(11) DEFAULT NULL,
  `cuotas` int(11) DEFAULT NULL,
  `comienzo_cuota` date DEFAULT NULL,
  `fin_cuota` date DEFAULT NULL,
  `importe_cuota` int(11) DEFAULT NULL,
  `cerrado_por` varchar(45) DEFAULT NULL,
  `es_app` tinyint(1) DEFAULT NULL,
  `estado` int(11) DEFAULT NULL,
  `vendedor` int(11) DEFAULT NULL,
  `poliza_madre` int(11) DEFAULT NULL,
  `observaciones` text,
  `version` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `policy_product_idx` (`producto`),
  KEY `policy_client_idx` (`cliente`),
  KEY `poliza_tipo_producto_idx` (`tipo_producto`),
  KEY `poliza_moneda_idx` (`moneda`),
  KEY `poliza_estado_idx` (`estado`),
  KEY `poliza_forma_pago_idx` (`forma_pago`),
  KEY `poliza_vendedor_idx` (`vendedor`),
  KEY `poliza_poliza_idx` (`poliza_madre`),
  CONSTRAINT `poliza_cliente` FOREIGN KEY (`cliente`) REFERENCES `cliente` (`id`),
  CONSTRAINT `poliza_estado` FOREIGN KEY (`estado`) REFERENCES `estado_poliza` (`id`),
  CONSTRAINT `poliza_forma_pago` FOREIGN KEY (`forma_pago`) REFERENCES `forma_pago` (`id`),
  CONSTRAINT `poliza_moneda` FOREIGN KEY (`moneda`) REFERENCES `moneda` (`id`),
  CONSTRAINT `poliza_poliza` FOREIGN KEY (`poliza_madre`) REFERENCES `poliza` (`id`),
  CONSTRAINT `poliza_producto` FOREIGN KEY (`producto`) REFERENCES `producto` (`id`),
  CONSTRAINT `poliza_tipo_producto` FOREIGN KEY (`tipo_producto`) REFERENCES `tipo_producto` (`id`),
  CONSTRAINT `poliza_vendedor` FOREIGN KEY (`vendedor`) REFERENCES `cotizacion_vendedor` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2746 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
